import React from 'react';
import {NavLink} from "react-router-dom";

const Navbar = () => {

    return(

        // <NavLink exact to="/" className="text-light m-2 font-weight-bold" style={styles.home}>Google Books</NavLink>

        <nav className="navbar navbar-expand-lg navbar-light bg-dark">
            <a className="navbar-brand" href="#">Steven Mann</a>
            <button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarNavAltMarkup" aria-controls="navbarNavAltMarkup" aria-expanded="false" aria-label="Toggle navigation">
                <span className="navbar-toggler-icon"></span>
            </button>
            <div className="collapse navbar-collapse" id="navbarNavAltMarkup">
                <div className="navbar-nav">
                    <NavLink className="nav-item nav-link active" href="#">Home <span className="sr-only">(current)</span></NavLink>
                    <NavLink className="nav-item nav-link" href="#">Contact</NavLink>
                    <NavLink className="nav-item nav-link" href="#">Portfolio</NavLink>
                </div>
            </div>
        </nav>

    )
}

export default Navbar;
